diff --git a/Modules/_lsprof.c b/Modules/_lsprof.c
index 257de4387c0..ae03b2a77f4 100644
--- a/Modules/_lsprof.c
+++ b/Modules/_lsprof.c
@@ -289,6 +289,10 @@ static void clearEntries(ProfilerObject *pObj)
 static void
 initContext(ProfilerObject *pObj, ProfilerContext *self, ProfilerEntry *entry)
 {
+// FIXME: Crash CWE-416: Use After Free
+    if (self == NULL || entry == NULL) {
+        return;
+    }
     self->ctxEntry = entry;
     self->subt = 0;
     self->previous = pObj->currentProfilerContext;
@@ -745,7 +749,8 @@ profiler_enable(ProfilerObject *self, PyObject *args, PyObject *kwds)
     Py_DECREF(monitoring);

     self->flags |= POF_ENABLED;
-    Py_RETURN_NONE;
+// FIXME: Crash CWE-416: Use After Free
+     Py_RETURN_NONE;
 }

 static void
@@ -753,11 +758,11 @@ flush_unmatched(ProfilerObject *pObj)
 {
     while (pObj->currentProfilerContext) {
         ProfilerContext *pContext = pObj->currentProfilerContext;
+        pObj->currentProfilerContext = pContext->previous;
         ProfilerEntry *profEntry= pContext->ctxEntry;
         if (profEntry)
             Stop(pObj, pContext, profEntry);
-        else
-            pObj->currentProfilerContext = pContext->previous;
+        pContext = NULL;
         if (pContext)
             PyMem_Free(pContext);
     }
